function a(arr) {
  const pairs = arr.sort().reduce((acc, cur) => {
    if(acc.length === 0 ||  acc[acc.length-1][0] !== cur)
      return [...acc, [cur, 1]];
    return acc.map((element, index) => index === acc.length-1 ? [acc[acc.length-1][0], acc[acc.length-1][1]+1] : element);
  }, []).sort((a, b) => b[1] - a[1]);
  return (pairs.map(el => el[0]).join(' '))
}

