int n ;

vector < ll > v , dp ;
deque < ll > dq ;

ll rec(int idx  ){
    if( idx >= n or !is_sorted(all(dq)) ) return 0;
  
    ll& ret = dp[idx];
    if(~ret) return ret;
    ret = max(ret , rec(idx+1));

    dq.push_back( v[idx] );
    ret = max(ret ,1+ rec(idx+1) );
    dq.pop_back() ;

    dq.push_front( v[idx] );
    ret = max(ret ,1+ rec(idx+1) );
    dq.pop_front();

    return ret ;
}



