int rec(int l, int r) {
    if (dp[l][r] != INF) {
        return dp[l][r];
    }
    int ans = INF;
    for (int m = l + 1; m < r; ++m) {
        ans = min(ans, rec(l, m) + rec(m, r) + a[r] - a[l]);
    }
    return dp[l][r] = ans;
}

