    for (int i = 0; i < n; ++i) {
        dp[i][i] = 1;
    }
    for (int len = 1; len < n; ++len) {
        for (int l = 0; l + len < n; ++l) {
            int r = l + len;
            dp[l][r] = max({dp[l + 1][r], dp[l][r - 1], dp[l + 1][r - 1] + (s[l] == s[r] ? 2: 0)});
        }
    }
    cout << dp[0][n - 1] << '\n';
    string ans(n, '#');
    int l = 0, r = n - 1;
    while (l <= r) {
        if (l == r && dp[l][r] == 1) {
            ans[l] = s[l];
            ++l;
            continue;
        }
        if (s[l] == s[r]) {
            ans[l] = s[l];
            ans[r] = s[r];
            ++l;
            --r;
        } else {
            if (dp[l + 1][r] > dp[l][r - 1]) {
                ++l;
            } else {
                --r;
            }
        }
    }
    for (auto i: ans) {
        if (i != '#') {
            cout << i;
        }
    }
}

