template <typename T>
class Vector {

public:

	Vector() : size(0), capacity(4), arr(new T[4]) {}

	Vector(const int vector_capacity) : size(0), capacity(vector_capacity), arr(new T[vector_capacity]) {}

	Vector(const initializer_list<T>& list) : arr(new T[list.size()]{}), size(list.size()), capacity(list.size()) {
		int i = 0;
		for (auto element : list) {
			arr[i] = element;
			i++;
		}
	}

	Vector(const Vector& other) : size(other.size), capacity(other.capacity), arr(new T[capacity]) {
		for (int i = 0; i < size; i++) {
			arr[i] = other.arr[i];
		}
		total_number_elements += size;
	}

	Vector& operator=(const Vector& other) {
		if (&other != this) {
			total_number_elements -= size;
			size = other.size;
			capacity = other.capacity;
			delete[] arr;
			arr = new T[capacity];
			for (int i = 0; i < size; i++) {
				arr[i] = other.arr[i];
			}
			total_number_elements += size;
		}
		return *this;
	} // копирующий оператор присваивания =

	Vector(Vector&& other) : size(other.size), capacity(other.capacity), arr(other.arr) {
		other.arr = nullptr;
		other.size = 0;
		other.capacity = 0;
	} // конструктор перемещения

	Vector& operator=(Vector&& other) {
		if (&other != this) {
			total_number_elements -= size;
			size = other.size;
			capacity = other.capacity;
			delete[] arr;
			arr = other.arr;
			other.arr = nullptr;
			other.size = 0;
			other.capacity = 0;
			total_number_elements += size;
		}
		return *this;
	} // перемещающий оператор присваивания =

	T& operator[] (const int index) {
		if (index < 0 || index >= size) {
			throw logic_error("Некорректный индекс");
		}
		return arr[index];
	} // перегрузка оператора индексирования (сеттер)

	T operator[] (const int index) const {
		if (index < 0 || index >= size) {
			throw logic_error("Некорректный индекс");
		}
		return arr[index];
	} // перегрузка оператора индексирования для константных объектов

	bool operator==(const Vector& right) const {
		if (right.size != size) {
			return false;
		}
		for (int i = 0; i < size; i++) {
			if (arr[i] != right.arr[i])
				return false;
		}
		return true;
	}

	bool operator!=(const Vector& right) const {
		return !(*this == right);
	}

	void Push_back(const T value) {
		if (size == capacity) {
			T* temp = new T[capacity * 2];
			for (int i = 0; i < size; i++) {
				temp[i] = arr[i];
			}
			delete[] arr;
			arr = temp;
			capacity *= 2;
		}
		arr[size] = value;
		size++;
		total_number_elements++;
	}

	void Pop_back() {
		if (size == 0) {
			throw runtime_error("Пустой контейнер");
		}
		arr[size - 1] = 0;
		size--;
		total_number_elements--;
	}

	int Size() {
		return size;
	}


	int Capacity() {
		return capacity;
	}

	void Insert(const int index, const T value) {
		if (index < 0 || index >= size) {
			throw logic_error("Некорректный индекс");
		}
		if (size == capacity) {
			T* temp = new T[capacity * 2];
			for (int i = 0; i < size; i++) {
				temp[i] = arr[i];
			}
			delete[] arr;
			arr = temp;
			capacity *= 2;
		}
		for (int i = size; i > index; i--) {
			arr[i] = arr[i - 1];
		}
		arr[index] = value;
		size++;
		total_number_elements++;
	}

	void Erase(const int index) {
		if (index < 0 || index >= size) {
			throw logic_error("Некорректный индекс");
		}
		for (int i = index; i < size - 1; i++) {
			arr[i] = arr[i + 1];
		}
		arr[size - 1] = 0;
		size--;
		total_number_elements--;
	}

	T GetValue(const int index) {
		if (index < 0 || index >= size) {
			throw logic_error("Некорректный индекс");
		}
		return arr[index];
	}

	void SetValue(const int index, const T value) {
		if (index < 0 || index >= size) {
			throw logic_error("Некорректный индекс");
		}
		arr[index] = value;
	}

	static int GetTotalNumberElements() {
		return total_number_elements;
	}

	void Print() {
		for (int i = 0; i < size; i++) {
			cout << arr[i] << " ";
		}
		cout << endl;
	}

	~Vector() {
		delete[] arr;
		total_number_elements -= size;
	}

private:
	int size;
	int capacity;
	T* arr;
	static int total_number_elements;
};

